{{short description|medieval ruins in Budapest, Hungary}}
{{use dmy dates|date=April 2020}}
The '''Tabán ruins''' ({{lang-hu|tabáni romok}}) are a group of medieval ruins in [[Budapest]], [[Hungary]]. They are located in [[Várkerület|District I]], in the [[Tabán]] neighbourhood, between Szarvas tér and Krisztina körút. The scattered ruins officially belong to one listed monument (ID 67).<ref>{{Cite web|url=https://muemlekem.hu/muemlek/show/67|title=Középkori romok, Budapest 1|website=muemlekem.hu}}</ref> The remains of the mainly medieval structures were discovered in 1936 by archaeologists after the demolition of a large part of the densely built Tabán quarter but significant parts of them disappeared in the 1960s when the whole area was rebuilt. A 15th-century building, named building no. I., and the retaining wall of the Ördög-árok stream are still visible above ground.

