'''Aduana''' is one of the seven major [[Akan people|Akan]] [[Clan|clans]] of [[Ghana]]. It is also said that it is the largest clan in terms of population.

==Origin==

{{Empty section|date=June 2015}}
'''Bold text'''
==[[Totem]]==
The [[totem]] of the Aduana clan is a [[Dog|dog.]] It is believed that a dog led the Aduana in their [[Human migration|migration]] process, and this dog lit the path to their settlement with fire in its mouth. It is also believed that this fire is still at the palace of the clan's major town. Many totems include a wold bear eagle owl and a fox.<ref>{{Cite web|title = twi.bb - Online Twi Dictionary - The Akan People - Abusua|url = http://www.twi.bb/akan-abusua.php|website = www.twi.bb|accessdate = 2015-06-16}}</ref>

