'''Leonid Šejka''' (1932–1970) was [[Serbia]]n painter and architect. He was a member and founder of art group Mediala.<ref>{{Cite web|url=https://wsimag.com/art/41084-the-trail-of-mediala|title=The trail of Mediala|date=2018-07-27|website=Wall Street International|language=en|access-date=2020-04-11}}</ref>

Šejka is now regarded as one of Yugoslavia's most original painters who tried to achieve a new objectivity - neither modern nor post-modern - by depicting the contingent object world in a magical space bounded by 'City', the 'Junk Yards', and the 'Castle'.

